/*Table structure for table `propietarios` */

DROP TABLE IF EXISTS `propietarios`;

CREATE TABLE `propietarios` (
  `codigo` int(11) NOT NULL DEFAULT '0',
  `apellido` char(50) DEFAULT NULL,
  `nombre` char(50) DEFAULT NULL,
  `telefono` char(50) DEFAULT NULL,
  `mail` char(50) DEFAULT NULL,
  `codigopropiedad` int(11) NOT NULL DEFAULT '0',
  `calle` char(50) DEFAULT NULL,
  `numerocalle` char(5) DEFAULT NULL,
  `tipopago` tinyint(3) NOT NULL DEFAULT '0',
  `deshabilitado` smallint(1) DEFAULT '0',
  PRIMARY KEY (`codigo`),
  KEY `FK_CodigoPropiedad` (`codigopropiedad`),
  KEY `FK_Propietarios_TipoPago` (`tipopago`),
  CONSTRAINT `FK_CodigoPropiedad` FOREIGN KEY (`codigopropiedad`) REFERENCES `propiedad` (`codigopropiedad`),
  CONSTRAINT `FK_Propietarios_TipoPago` FOREIGN KEY (`tipopago`) REFERENCES `tipopago` (`tipopago`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

