/* Procedure structure for procedure `SP_Cobrador` */

/*!50003 DROP PROCEDURE IF EXISTS  `SP_Cobrador` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Cobrador`(
  p_nombre char(50),
  p_direccion char(50),
  p_telefono char(30)
)
BEGIN
        SET @p_codigocobrador = (SELECT if (ISNULL(MAX(codigocobrador)),1,(SELECT MAX(codigocobrador)+1)) FROM cobrador);
        INSERT  INTO Cobrador (codigocobrador, nombre, direccion, telefono)
        VALUES (@p_codigocobrador, p_nombre, p_direccion, p_telefono);
        SELECT @p_codigocobrador;
END */$$
DELIMITER ;

/* Procedure structure for procedure `SP_Comprobante` */

/*!50003 DROP PROCEDURE IF EXISTS  `SP_Comprobante` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Comprobante`(
  p_descripcion char(25),
  p_tipo Tinyint(3)
)
BEGIN
        SET @p_codigo = (SELECT if (ISNULL(MAX(codigocomprobante)),1,(SELECT MAX(codigocomprobante)+1)) FROM comprobantes);
        INSERT  INTO comprobantes (codigocomprobante, descripcion, tipo)
        VALUES (@p_codigo, p_descripcion, p_tipo);
        SELECT @p_codigo;
END */$$
DELIMITER ;

