        VALUES (@p_codigo, p_periodomes, p_periodoano, p_importe);
        SELECT @p_codigo;
END */$$
DELIMITER ;

/* Procedure structure for procedure `SP_Egreso` */

/*!50003 DROP PROCEDURE IF EXISTS  `SP_Egreso` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Egreso`(
  p_fechacomprobante date,
  p_codigocomprobante Tinyint(3),
  p_numerocomprobante int,
  p_codigoconcepto char(3),
  p_descripcion varchar(50),
  p_total double(10,2)
)
BEGIN
        SET @p_codigo = (SELECT if (ISNULL(MAX(codigoegreso)),1,(SELECT MAX(codigoegreso)+1)) FROM egresos);
        INSERT INTO egresos (codigoegreso, fechacomprobante, fechacarga, codigocomprobante, numerocomprobante, codigoconcepto, estado, descripcion, total)
        VALUES (@p_codigo, p_fechacomprobante, now(), p_codigocomprobante, p_numerocomprobante, p_codigoconcepto, 1, p_descripcion, p_total);
        SELECT @p_codigo;
END */$$
DELIMITER ;

