/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Talonario`(
  p_codigocomprobante tinyint(3),
  p_numerodesde int,
  p_numerohasta int,
  p_codigocobrador int
)
BEGIN
        SET @p_codigo = (SELECT if (ISNULL(MAX(codigotalonario)),1,(SELECT MAX(codigotalonario)+1)) FROM talonarios);
